import { Banner } from "../components/Banner";

export const Media = () => {
  const mediaList = [
    { name: "Поздравление с Днем матери!", date: "1 октября 2021" },
    { name: "Поздравление с Новым годом!", date: "31 декабря 2021" },
    { name: "Поздравление с Рождеством!", date: "6 января 2022" },
  ];

  return (
    <main>
      <Banner pageName={"Галерея"} />
      <div className="wrapper wrapperMedia">
        {mediaList.map((media, key) => (
          <a className="card" href="media1.html">
            <iframe
              width="560"
              height="315"
              src="https://www.youtube.com/embed/GM8N5wum-Jw"
              title="YouTube video player"
              frameborder="0"
              allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
              allowfullscreen
            ></iframe>
          </a>
        ))}
      </div>
      <div></div>
    </main>
  );
};
